  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import { Playground, PropsTable } from 'docz';
import Loading from './Loading';

export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}>
<MDXTag name="h1" components={components} props={{"id":"loading"}}>{`Loading`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"properties"}}>{`Properties`}</MDXTag>
<PropsTable of={Loading} />
<MDXTag name="h2" components={components} props={{"id":"basic-usage"}}>{`Basic usage`}</MDXTag>
<Playground __position={1} __code={'<Loading />\n<Loading tip=\"loading\" />'} __scope={{props: this ? this.props : props,Loading}}>
  <Loading />
  <Loading tip="loading" />
</Playground>
           </MDXTag>
  }
}
